      hasBFrames: picOrderCntType === 2 ? false : true,
      fixedFrameRate: fixedFrameRate,
      frameDuration: frameDuration,
    };
  }

  static readSliceType(decoder) {
    // skip NALu type
    decoder.skipBits(8);
    // discard first_mb_in_slice
    decoder.skipUEG();
    // return slice_type
    return decoder.readUEG();
  }
